    on 10/17/08 was incorrectly coded as P2008.  This contribution has now been changed
    to G2008.  Our committee has had problems with on line contributions through our
    software vendor being attributed to the proper election.  It was Mr. Schendle?s
    intent to contribute to the G2008.  $2300.00 of the 10/22/08 contribution from
    TCB Investments was attributed to the G2008 to partner Jonathan St. Amant.  $2300.00
    of the 10/22/08 contribution from TCB Investments should have been attributive
    to O2008 Special General Debt to partner Jeffery St. Amant.  These changes reflect
    the original intention of the donors.  Several itemized and unitemized contributions
    after the 10/4/08 deadline for accepting primary contributions were incorrectly
    attributed to P2008.  All of these were online contributions that were part of
    a problem we experience with our software vendor.  We have changed these to the
    proper election G2008 for this amendment.  John W. de Gravelles contributed $1000.00
    on 10/22/08 for the G2008.  On 10/27/08 John deGeneras, Jr. contributed $500.00
    for the G2008, which was incorrectly reported as P2008 and has now been changed.
    \ Mr. de Gravelles and Mr. deGeneras are two different people.  The records for
    Michael C. Palmintier and Michael Palmintier were combined for this amended report.
